		hook->jumpt[13] = 0x46; // nop
		hook->jumpt[12] = 0xe4;

		hook->jumpt[15] = 0xbd;
		hook->jumpt[14] = 0x00;


		 
		memcpy(&hook->jumpt[16], (unsigned char*)&hook->patch, sizeof(unsigned int));


		unsigned int orig = addr - 1; 


		//char* cmd_disas_format = "arm-none-eabi-objdump -D --target binary -Mforce-thumb -marm %s";

		//char cmd_disas[256];
